import React from "react";

export default function HomePage() {
  return (
    <div className="text-gray-800">
      {/* Hero Section */}
      <main className="container mx-auto text-center py-16">
        <h2 className="text-4xl font-extrabold mb-4">
          Welcome to Kalaniketan
        </h2>
        <p className="text-lg text-gray-600 mb-6">
          Protect what matters most with our comprehensive insurance plans
          tailored for your health, life, and vehicle.
        </p>
        <button className="bg-purple-700 text-white px-6 py-2 rounded-lg hover:bg-purple-800">
          Explore Plans
        </button>
      </main>
    </div>
  );
}
